import React from 'react';


class SearchCrypto extends React.Component {
    render() {
        return(
            <form className = "crypto-form">
                <input type = "text" placeholder = "Crypto Code" className = "coin-code"></input>
                <input type = "text" placeholder = "Fiat Currency Code" className = "currency-code"></input>
                <button type = "submit">Get Coin</button>
            </form>
        );
    }
}

export default SearchCrypto;
